import './App.css';

import React, { Component } from 'react'
import Nav from './components/Nav';
import News from './components/News';
import {
  BrowserRouter as Router,
  Switch,
  Route,

} from "react-router-dom";
export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Nav></Nav>
          <News pagesize={18} category="general"></News>
          <Switch>
          <Route path="/General">
          <News pagesize={18} category="General"></News>
          </Route>
          <Route path="/Politics">
          <News pagesize={18} category="Politics"></News>
          </Route>
          <Route path="/Economics">
          <News pagesize={18} category="Economics"></News>
          </Route>
        </Switch>
        </Router>

      </div>
    )
  }
}
